  flex: 1;
`;

const HomeTop = styled(View)`
  background-color: #fff;
  height: 50px;
  margin: 20px;
`;

export default function Home(): ReactElement {
  return (
    <HomeDiv>
      <HomeTop></HomeTop>
    </HomeDiv>
  );
}
